import React from 'react';
import { List } from './styles';

const UserNav: React.FC = () => {
  return (
    <List>
      <li key='1'>
        <button>
          <p>Вход</p>
        </button>
      </li>
      <li key='2'>
        <button>
          <p>Корзина</p>
        </button>
      </li>
    </List>
  )
};

export default UserNav;
